import React from "react";

const MovieCard = ({ movie }) => {
  return (
    <>
   

            <div className="main">
              {movie.map((data) => {
                let { Title, Poster, Year } = data;
                return (
                  <>
                    <div className="card ">
                      <div className="name ">Movies - {Title}</div>
                      <div className="image">
                        <img src={Poster} alt="Image is Not Yet" />
                      </div>
                      <div className="year">{Year}</div>
                    </div>
                  </>
                );
              })}
            </div>
      ]
    

    </>
  );
};

export default MovieCard;
